SET @@AUTOCOMMIT = 1;
SET FOREIGN_KEY_CHECKS=1;

DROP DATABASE IF EXISTS SBWDSF;
CREATE DATABASE SBWDSF;

USE SBWDSF;

CREATE TABLE User(
    user_id int NOT NULL AUTO_INCREMENT PRIMARY KEY,
    username varchar(100) NOT NULL,
    password varchar(100) NOT NULL,
    fname varchar(100) NOT NULL,
    lname varchar(100) NOT NULL,
    email varchar(100) NOT NULL,
    dob date,
    phone varchar(100),
    image longblob
) AUTO_INCREMENT = 1;

CREATE TABLE Item(
    item_id int NOT NULL AUTO_INCREMENT PRIMARY KEY,
    name varchar(100) NOT NULL,
    price decimal(10,2) NOT NULL,
    description varchar(1000) NOT NULL,
    image longblob NOT NULL,
    seller int,
    item_condition varchar(12),
    category varbinary(3),
    
    FOREIGN KEY (seller) REFERENCES User(user_id)
    ON DELETE NO ACTION ON UPDATE CASCADE
) AUTO_INCREMENT = 1;

CREATE TABLE Cart(
    user_id int NOT NULL,
    item_id int NOT NULL,
    quantity int NOT NULL,

    PRIMARY KEY (user_id, item_id),
    FOREIGN KEY (user_id) REFERENCES User(user_id)
    ON DELETE NO ACTION ON UPDATE CASCADE,
    FOREIGN KEY (item_id) REFERENCES Item(item_id)
    ON DELETE NO ACTION ON UPDATE CASCADE
);

CREATE TABLE PurchaseOrder(
    order_id int NOT NULL AUTO_INCREMENT,
    user_id int NOT NULL,
    item_id int NOT NULL,
    quantity int NOT NULL,
    card_number VARBINARY(100) NOT NULL,
    cvv VARBINARY(100) NOT NULL,
    expiration varchar(10) NOT NULL,
    card_holder_name varchar(100) NOT NULL,
    street_address varchar(100) NOT NULL,
    city varchar(100) NOT NULL,
    state varchar(20) NOT NULL,
    post_code int NOT NULL,
    phone_number bigint NOT NULL,

    PRIMARY KEY (order_id, user_id, item_id),
    FOREIGN KEY (user_id) REFERENCES User(user_id)
    ON DELETE NO ACTION ON UPDATE CASCADE,
    FOREIGN KEY (item_id) REFERENCES Item(item_id)
    ON DELETE NO ACTION ON UPDATE CASCADE
) AUTO_INCREMENT = 1;

CREATE user IF NOT EXISTS dbadmin@localhost;
GRANT all privileges ON SBWDSF.Item TO dbadmin@localhost;
GRANT all privileges ON SBWDSF.User TO dbadmin@localhost;
GRANT all privileges ON SBWDSF.Cart TO dbadmin@localhost;
GRANT all privileges ON SBWDSF.PurchaseOrder TO dbadmin@localhost;

